'use strict';
let DxFeedConnectCommand = require('./DxFeedConnectCommand.js');
class DxFeedConnectCommandBuilder extends DxFeedConnectCommand {
    setUrl(url) {
        this.url = url;
    }
    setSsoTokenController(ssoTokenController) {
        this.ssoTokenController = ssoTokenController;
    }
    setCommandFactory(commandFactory) {
        this.commandFactory = commandFactory;
    }
    setDxFeedConnection(dxFeedConnection) {
        this.dxFeedConnection = dxFeedConnection;
    }
    build() {
        return this;
    }
}
module.exports = DxFeedConnectCommandBuilder
